    public Trend[] getBestSearch(String[] terms){
    	
    	int[][] trends = getTrends(terms);
    	
    	if(trends == null) return null;
	    
	    //Score terms
	    double[] scores = new double[trends.length];
		for(int i = 0; i < trends.length; i++){
			scores[i] = scoreTrend(trends[i]);
		}
		
		//find correlated terms
		double[][] corr = new double[trends.length][trends.length];
		for(int i = 0; i < trends.length; i++){
			for(int j = 0; j<trends.length; j++){
				corr[i][j] = findCorrelation(decay(trends[i]),decay(trends[j]));
			}
		}
		
		//calculate decayed correlation 
		int[] best = new int[trends.length];
		for(int i = 0; i < trends.length; i++){
			double bestcorr = Integer.MIN_VALUE;
			for(int j = 0; j<trends.length; j++){
				if(i!=j && corr[i][j]/(double)Math.abs(scores[i]-scores[j]) > bestcorr){
					best[i] = j;
					bestcorr = corr[i][j]/(double)Math.abs(scores[i]-scores[j]);
				}
			}
			//System.out.println(terms[i] + ":\n      " + scores[i]*getTrendiness(trends[i]) + " /  " + terms[best[i]] + " - " + corr[i][best[i]] + " " );
		}
		
		//shitty sort based on score * trendiness
		LinkedList<Integer> list = new LinkedList<Integer>();
		for(int i = 0; i < trends.length; i++){
			int j = 0;
			double curscore = scores[i]*getTrendiness(trends[i]);
			while(j < list.size() && scores[list.get(j)]*getTrendiness(trends[list.get(j)]) > curscore){
				j++;
			}
			list.add(j, i);
		}
		
		for(int i = 0; i < list.size(); i++){
			int j = list.get(i);
		}
		
		int best1 = 0, best2 = 0, best3 = 0;
		best1 = list.get(0);
		list.removeFirstOccurrence(best1);
		list.removeFirstOccurrence(best[best1]);
		best2 = list.get(0);
		list.removeFirstOccurrence(best2);
		list.removeFirstOccurrence(best[best2]);
		best3 = list.get(0);
		
		Trend[] besttrends = new Trend[]{new Trend(terms[best1] + " " + terms[best[best1]], scores[best1]*getTrendiness(trends[best1])),
				new Trend(terms[best2] + " " + terms[best[best2]], scores[best2]*getTrendiness(trends[best2])),
				new Trend(terms[best3] + " " + terms[best[best3]], scores[best3]*getTrendiness(trends[best3]))};

		
		return besttrends;
    }
    
    private double getTrendiness(int[] trend){
    	//maybe make it normal distribution and use standard deviation?
    	
    	int current = trend[0];
    	double total = 0.0;
    	
    	double alpha = 0.95;
    	double decay = 1;
    	for(int t : trend){
    		if(t < current){
    			total += 1*decay;
    		}
    		if(t == current){
    			//total += 0.5*decay;
    		}
    		decay *= alpha;
    	}
    	double sum = (1-Math.pow(0.95, trend.length))/(1-0.95);
    	return total / (sum);
    }
	 
	private int[][] getTrends(String[] terms){
		int[][] trends = new int[terms.length][];
    	
    	//Get trends for all terms
	    for(int k = 0; k<Math.ceil(terms.length/5.0); k++){
	    	int sublength = 0;
	    	if( (terms.length-5*k) < 5 ){
	    		sublength = terms.length-5*k;
	    	}else{
	    		sublength = 5;
	    	}
	    	String[] subterms = new String[sublength];
	    	for(int i = 0; i < subterms.length; i++){
	    		subterms[i] = terms[5*k+i];
	    	}
	    	int[][] subtrends = findTrends(subterms);
	    	if(subtrends == null) return null;
	    	for(int i = 0; i < subtrends.length; i++){
	    		trends[5*k+i] = subtrends[i];
	    	}
	    }
	    
	    return trends;
	}
	
	private double findCorrelation(double[] trend1, double[] trend2){
		double cov = 0.0, var1 = 0.0, var2 = 0.0, mean1 = 0.0, mean2 = 0.0;
		for(int i = 0; i < trend1.length; i++){
			mean1 += trend1[i]/(double)trend1.length;
			mean2 += trend2[i]/(double)trend2.length;
		}
		for(int i = 0; i < trend1.length; i++){
			cov += (trend1[i]-mean1)*(trend2[i]-mean2)/trend1.length;
			var1 += (trend1[i]-mean1)*(trend1[i]-mean1)/trend1.length;
			var2 += (trend2[i]-mean2)*(trend2[i]-mean2)/trend2.length;
		}
		return cov/(Math.sqrt(var1)*Math.sqrt(var2));
	}
	
	
	private double[] decay(int[] trend){
		double[] dtrend = new double[trend.length];
		double alpha = 0.95;
		double score = 0;
		double decay = 1;
		for(int i = 0; i<trend.length; i++){
			dtrend[i] = trend[i]*decay;
			decay*=alpha;
		}
		return dtrend;
	}
	
	private double scoreTrend(int[] trend){
		double alpha = 0.95;
		double score = 0;
		double decay = 1;
		for(int i = 0; i<trend.length; i++){
			score += trend[i]*decay;
			decay*=alpha;
		}
		return score;
	}
	
