	private int[][] parseResponse(String response, int numterms) {
		int curindex = 0;
		String search = "\"f\":";
		if(response == null) return null;
		int count = (response.length() - response.replace("{\"c\":", "").length())/5;
		
		int[][] trends = new int[numterms][count];
		while(response.substring(curindex).contains(search)){
			curindex = response.indexOf(search, curindex) + 1;
			count--;
			for(int i = 0; i<numterms; i++){
				curindex = response.indexOf(search, curindex) + 1;
				String substr = response.substring(curindex + 4, curindex+4+response.substring(curindex + 4).indexOf("\""));
				int trend = Integer.parseInt(substr);
				trends[i][count] = trend;
			}
		}
		
		return trends;
	}

